import { withRouter } from 'react-router-dom';

import React, { Component } from 'react';

function SearchPatient(props) {

    const { screen, setScreen } = props;

    return (
        <div>
            <h2>Search Patient: {screen}</h2>
        </div>
    );

}

export default withRouter(SearchPatient);
